import './PostReviewPage.css';
import * as React from "react";
import Rating from '@mui/material/Rating';

let ratings = [0,0,0];
const handleRatingsChange = (index, val) => {
    ratings[index] = val;
    console.log(ratings);
}

export default function ReviewRatings() {
    return (
        <div className='review-ratings'>
            <h2>Ratings</h2>
            <h4>Security</h4>
            <Rating name="half-rating" precision={2} size='large' onChange={handleRatingsChange} />
        </div>
    )
}
